import react from "react";
import { Slide } from "react-slideshow-image";
import img1 from "../utils/img/img1.jpg";
import img2 from "../utils/img/img2.jpg";
import img3 from "../utils/img/img3.jpg";

const proprietes = {
  duration: 5000,
  transitionDuration: 500,
  infinite: true,
  indicators: true,
  arrows: true,
};

const slideImage = [
  {
    url: "https://cdn.pixabay.com/photo/2021/09/07/07/11/game-console-6603120__340.jpg",
    caption: "Slide 1",
  },
  {
    url: "https://cdn.pixabay.com/photo/2021/02/16/18/55/gamer-6022003__340.png",
    caption: "Slide 1",
  },
  {
    url: "https://cdn.pixabay.com/photo/2021/09/07/07/11/game-console-6603120__340.jpg",
    caption: "Slide 1",
  },
];

const Slideshow = () => {
  return (
    <div className="containerSlide">
      <Slide {...proprietes}>
        <div className="each-slide">
          <div>
            <img src={img1} alt="moi" />
          </div>
        </div>
        <div className="each-slide">
          <div>
            <img src={img2} alt="moi" />
          </div>
        </div>
        <div className="each-slide">
          <div>
            <img src={img3} alt="moi" />
          </div>
        </div>
      </Slide>
    </div>
  );
};

export default Slideshow;
